// ==UserScript==
// @name         ProtonDB Peek
// @namespace    https://github.com/BlackRabbit22/ProtonDB-Peek
// @version      1.0
// @description  Peek at the ProtonDB status of an app without leaving Steam.
// @author       BlackRabbit22
// @icon         https://www.protondb.com/sites/protondb/images/site-logo.svg
// @homepage     https://github.com/BlackRabbit22/ProtonDB-Peek
// @downloadURL  https://raw.githubusercontent.com/BlackRabbit22/ProtonDB-Peek/main/Userscript/protondb.js
// @match        https://store.steampowered.com/app/*
// @grant        GM_xmlhttpRequest
// ==/UserScript==

// get appID from URL
const appID = window.location.href.split("/")[4];

// SVG badges encoded to base64
const tierBadges = {
  platinum:
    "",
  gold: "",
  silver:
    "",
  bronze:
    "",
  borked:
    "",
  pending:
    "",
  unverified:
    "",
};

const nativeBadge = {
  nativeYes:
    "",
  nativeNo:
    "",
};

// add HTML elements to page
const decorate = (tierBadge, protonDBHref, nativeBadge, reviewCount) => {
  let protonTier = document.createElement("div");
  let userReviewTab = document.getElementsByClassName("user_reviews")[0];
  protonTier.innerHTML = `
  <div id="protonDB-Peek">
  <div id="protonDB" class="dev_row">
    <div class="subtitle column">ProtonDB:</div>
    <div data-tooltip-html="Total reports: ${reviewCount}" class="summary column">
      <a href="${protonDBHref}" target="_blank">
        <img src="data:image/svg+xml;base64,${tierBadge}" />
      </a>
    </div>
  </div>
  
  <div id="linux-support" class="dev_row">
    <div class="subtitle column">Linux Support:</div>
    <div class="summary column">
      <div id="requirementsBtn" style="cursor: pointer">
        <img src="data:image/svg+xml;base64,${nativeBadge}" />
      </div>
    </div>
  </div>
</div>
`.trim();

  userReviewTab.appendChild(protonTier.firstChild);
  document.getElementById("requirementsBtn").addEventListener("click", function () {
    let linuxTab = document.querySelector('[data-os="linux"]');

    if (linuxTab !== null) linuxTab.click();
    document.querySelector("div.game_page_autocollapse.sys_req").scrollIntoView();
  });
};

// get tier from protondb API
const getTier = (appID) => {
  const url = `https://www.protondb.com/api/v1/reports/summaries/${appID}.json`;

  return new Promise((resolve, reject) => {
    GM_xmlhttpRequest({
      method: "GET",
      url: url,
      onload: (response) => {
        if (response.status == 404) resolve(["unverified", "0"]);
        resolve([JSON.parse(response.responseText).tier, JSON.parse(response.responseText).total]);
      },
      onerror: reject,
    });
  }).catch((error) => console.log(error));
};

// check if title runs natively on linux
const isNative = () => {
  if (document.querySelector('[data-os="linux"]') !== null) return nativeBadge.nativeYes;

  return nativeBadge.nativeNo;
};

getTier(appID)
  .then((pDBData) => {
    const reviewCount = pDBData[1];
    const tierBadge = tierBadges[pDBData[0]];
    const protonDBHref = `https://www.protondb.com/app/${appID}`;
    const nativeBadge = isNative();

    decorate(tierBadge, protonDBHref, nativeBadge, reviewCount);
  })
  .catch((e) => void e);
